INSERT INTO `recetas` (`id`, `nombre`, `preparacion`, `categoria`, `imagen`, `fecha`, `creador`, `activo`) VALUES
(1, 'Arroz con huevo', 'Empecemos cociendo el arroz, según el procedimiento habitual. Luego haremos también los huevos, pero haciendo lo que suele llamarse huevos poché; esto es, con la clara cuajada, inmaculadamente blanca, y la yema aún temblorosa y casi líquida, pero con temperatura.\r\n\r\n¿Cómo se hace? En una sartén profunda o una olla ponga a hervir un poco de agua, calcule cinco centímetros de altura. Una vez que haya alcanzado el punto de hervor, disminuya la potencia del fuego de manera de que el agua se mantenga caliente. Luego, proceda a colocar los huevos reventados, uno por uno.\r\n\r\nCon una cuchara, tape la yema del huevo con la clara. Dejar que se cocine unos tres minutos. Con la ayuda de una espumadera, retire el huevo del agua y deje enfriar.\r\n\r\nPara dar algo más de gracia a la combinación, en otra sartén coloque un chorrito de aceite de oliva, láminas de ajo y cuadraditos de ají o pimiento picante. Cuando el aceite se haya empezado a adorar, retire el ají y el ajo de la sartén. Inmediatamente, coloque el arroz ya cocido y saltee ligeramente.\r\n\r\nYa en el plato, un poco de sal y que cada uno sea libre de destrozar y mezclar los huevos con el arroz a su gusto.\r\n\r\nDisfrutará de una combinación que no por vieja ni por cotidiana deja de ser perfecta, una de esas cosas de toda la vida, de todos los días, que cada vez valoramos más. Y es que para comer muy bien y con placer no hace falta dar la vuelta al mundo en busca de ingredientes exóticos, tener un laboratorio en la cocina o tirarse horas en la confección de un plato. En general, lo sencillo es bueno… y viceversa.', 7, , '2022-12-10 10:27:01', 1111, 0);
INSERT INTO `recetas` (`id`, `nombre`, `preparacion`, `categoria`, `imagen`, `fecha`, `creador`, `activo`) VALUES
(2, 'Pollo Frito', 'El primer paso es hacer una marinada para que el pollo quede bien condimentado. Por lo tanto, condimente los pedazos de pollo con ajo, jugo de limón, sal y pimienta y déjelos marinando en la heladera 30 minutos.\r\n\r\nEn un recipiente, mezcle la leche, el agua y el huevo. Esta mezcla dejará el pollo frito crocante y tierno.\r\n\r\nPonga el pollo en la mezcla preparada anteriormente. Asegúrese de que todos los lados del pollo quedaron embebidos en la mezcla.\r\n\r\nAhora, vamos a empanar y tenemos un consejo increíble para facilitar el proceso. Ponga la harina con una pizca de sal en una bolsa de plástico. Ponga los pedazos de pollo dentro de la bolsa con la harina, mézclelos y balancéelos para que la harina se fije a la carne.\r\n\r\nMuy bien. Ahora, pasemos a la fritura.\r\n\r\nVierta bastante aceite en una olla honda y llévela al fuego alto. Recuerde: los pedazos de pollo deben flotar en el aceite, entonces, no ahorre en aceite. Cuando el aceite esté bien caliente, sumerja de a poco y con cuidado algunos pedazos de pollo. No los ponga a todos de una vez para no enfriar el aceite – si lo hace, el pollo no quedará con esa cascarita crocante.\r\n\r\nDeje freír el horno en el aceite 5 minutos, revuelva y delo vuelta. Cuando los pedazos estén bien dorados y queden flotando, están listos para escurrir y servir', 1, , '2022-12-10 10:47:26', 1111, 1);
INSERT INTO `recetas` (`id`, `nombre`, `preparacion`, `categoria`, `imagen`, `fecha`, `creador`, `activo`) VALUES
(3, 'Chateaubriand de ternera', 'La primera parte es cuadrar la pieza formando un cilindro, para lo cual tendremos que cortar la punta y atar con un hilo de cocina la pieza. Así cuando luego la hagamos en el horno, se cocinará de manera uniforme. Una vez atada, doramos el chateaubriand en una sartén con aceite de oliva dándole la vuelta por todas sus caras. Cuando esté dorado, lo pasamos a una fuente de horno y lo cocinamos sin más ingredientes a 180º durante 20 minutos. Así queda tierno y jugoso y con un aspecto muy sonrosado. Si queréis más hecha la carne, podéis prolongar la cocción 5 o 10 minutos más, pero así queda de lujo. Una vez asada la carne, la cubrimos con papel aluminio y la dejamos reposar unos diez minutos para que se asienten y circulen los jugos. Para hacer la salsa, cortamos todos los recortes que habíamos hecho al cuadrar la pieza y los doramos en la misma sartén. Añadimos también la cebolla y la zanahoria y seguimos dorando durante unos diez minutos, dejando que todos los ingredientes tomen color. Añadimos el brandy y dejamos que reduzca hasta evaporar. Agregamos entonces la nata líquida y los jugos que suelte la carne al filetearla en tajadas de un cm y medio de grosor. Colamos y damos un último hervor al conjunto. Servimos un par de filetes por ración con un poco de nuestro puré champ irlandés de patata y cebolleta como guarnición y una cucharada de la salsa servida por encima como veis en la foto superior, y ya lo podremos llevar a la mesa para deleite de nuestra familia, o de nuestros invitados. Triunfo asegurado.', 1, , '2022-12-10 10:49:04', 2222, 1);
